import { useState, useEffect } from "react";
import { Link } from "react-router-dom";


export default function ProjectList() {
    const [projects, setProjects] = useState([]);

    useEffect(() => {
        getProjects();
    }, []);
    function formatDate(dateString) {
        const date = new Date(dateString);
        const day = date.getDate().toString().padStart(2, '0'); // Add leading zero if needed
        const month = (date.getMonth() + 1).toString().padStart(2, '0'); // Months are zero-based
        const year = date.getFullYear();
        return `${day}.${month}.${year}`;
    }
    function getProjects() {
        fetch("http://localhost:4000/api/Project/allProjects")
            .then(response => {
                console.log(response)
                if (response.ok) {
                    return response.json()
                }
                throw new Error()
            })
            .then(data => {
                console.log(data)
                setProjects(data)
            })
            .catch(error => {
                alert("Unable to get the data")
            })
    }

    return (
        <div className="container my-4">
            <h2 className="text-center mb-4">
                Projects
            </h2>

            <div className="row mb-3">
                <div className="col">
                    <Link className="btn btn-primary me-1" to="/create" role="button"> Create Project </Link>
                    <button type="button" className="btn btn-outline-primary" onClick={getProjects}>Refresh</button>
                </div>

                <div className="col"></div>
            </div>

            <table className="table">
                <thead>
                    <tr>
                        <th>Id</th>
                        <th>Project Name</th>
                        <th>Customer Company</th>
                        <th>Executor Company</th>
                        <th>Priority</th>
                        <th>Start Date</th>
                        <th>End Date</th>
                        {/* <th>Project Manager</th> */}
                        <th>Employees</th>
                        <th>Actions</th>


                    </tr>
                </thead>
                <tbody>

                    {projects.map((project, index) => (
                        <tr key={index}>
                            <td>{project.id}</td>
                            <td>{project.name}</td>
                            <td>{project.customerCompany}</td>
                            <td>{project.executorCompany}</td>
                            <td>{project.priority}</td>
                            <td>{formatDate(project.startDate)}</td>
                            <td>{formatDate(project.endDate)}</td>
                            {/* <td>{project.projectManager.firstName}</td> */}
                            <td>
                                <div className="accordion" id={`accordionExample${index}`}>
                                    <div className="card">
                                        <div className="card-header" id={`heading${index}`}>
                                            <h2 className="mb-0 d-flex justify-content-center align-items-center">
                                                <button className="btn btn-link"
                                                    type="button" data-toggle="collapse"
                                                    data-target={`#collapse${index}`}
                                                    aria-expanded="true"
                                                    aria-controls={`collapse${index}`}
                                                    style={{ textAlign: 'center', color: '#007bff', fontSize: '1rem', fontWeight: 'bold' }}
                                                >
                                                    View Employees
                                                </button>
                                            </h2>
                                        </div>
                                        <div id={`collapse${index}`} className="collapse" aria-labelledby={`heading${index}`} data-parent={`#accordionExample${index}`}>
                                            <div className="card-body">
                                                <ul className="list-group">
                                                    {project.employees.map((emp, empIndex) => (
                                                        <li key={empIndex} className="list-group-item">
                                                            {emp.firstName} {emp.lastName} - {emp.position}
                                                        </li>
                                                    ))}
                                                </ul>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </td>

                            <td>
                                {/* Action buttons */}
                                <Link className="btn btn-primary me-1" to={`/edit/${project.id}`} role="button"> Edit </Link>
                                <button type="button" className="btn btn-outline-primary btn-danger text-white">Delete</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    )
}
